import React, { useState } from 'react'
import Button from 'react-bootstrap/Button'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Grid from '@mui/material/Grid';
import Container from '@mui/material/Container';

const HandleTextDataToPredict = ({onSubmit}) => {
    const [textValue, setTextValue] = useState(null)
    const [textValueMessage, setTextValueMessage] = useState("")
    //const [textValue, setTextValue] = useState(null)
    //const [textValue, setTextValue] = useState(null)

    return (
        <Container maxWidth='md' sx={{width: "90%"}}>
            <Box
                component="form"
                noValidate
                autoComplete="off"
                style={{color: "white"}}
                >
                <Grid container spacing={2}>
                    <Grid item xs={8}>
                        <TextField
                            //error = {textValue === null?}
                            fullWidth 
                            label="Text"
                            required
                            id="outlined-required"
                            helperText={textValueMessage}
                        />
                    </Grid>
                    <Grid item xs={4}>
                        <TextField
                            fullWidth 
                            required
                            id="outlined-disabled"
                            label="Class"
                        />
                    </Grid>
                </Grid>
                <Button onClick={handleSubmit}>click</Button>
            </Box>
        </Container>
    );
}

export default HandleTextDataToPredict
